import { useState } from 'react';
import './App.css';

function App() {

  const[name, setName] = useState()

  return (
    <div className="App">
      <div className='information'>
        <label>Name:</label>
        <input type="text"></input>
        <label>Age:</label>
        <input type="number"></input>
        <label>Pozition:</label>
        <input type="text"></input>
        <label>Country:</label>
        <input type="text"></input>
        <label>Wage (year)</label>
        <input type="text"></input>
        <button>Send</button>
      </div>
    </div>
  );
}

export default App;
